import React from "react";

function Navbar() {
  return (
    <nav className="navbar">
      <div className="logo">DonateEase</div>
      <ul>
        <li><a href="/">Home</a></li>
        <li><a href="/campaigns">Campaigns</a></li>
        <li><a href="/donate">Donate</a></li>
        <li><a href="/login">Login</a></li>
      </ul>
    </nav>
  );
}

export default Navbar;
